import axios from 'axios'
const baseUrl = '/api/workouts'

const create = newWorkout => {
    const request = axios.post(baseUrl, newWorkout)
    return request.then(response => response.data)
}

const update = (id, newWorkout) => {
    const request = axios.put(`${baseUrl}/${id}`, newWorkout)
    return request.then(response => response.data)
}

export default { create, update }
